import React, { useState } from "react";

function TodoList() {
  const [todayList, setTodayList] = useState([]);

  return (
    <div className="container">
      <input type="text" />
      <button>Add todo</button>
      <button>After 5 years</button>

      <h1>Todo list</h1>
      <h2>Today</h2>

      <ul>
        <li>Go to course</li>
        <li>Read a book</li>
      </ul>

      <h2>After 5 years plan</h2>
      <ul>
        <li>Go to Paris</li>
        <li>Go to Dubai</li>
      </ul>
    </div>
  );
}

export default TodoList;
